    false,nt"url": null,nt"notes": "This annual narrative report for the Annada
    District of Mark Twain National Wildlife Refuge summarizes Refuge activities during
    the 1996 calendar year.  Clarence Cannon NWR, the Delair Division, the Gardner Division,
    the Gregory Landing Division, and the Harlow Island Division are included.  The
    report begins with a summary of the yearu2019s highlights and climatic conditions.
     Land acquisition is also covered.  The report includes a planning section which
    discusses public participation and compliance with environmental and cultural mandates.
     Refuge administration is outlined; information about personnel, volunteer programs,
    funding, and safety is given.  Habitat management is also covered.  Subjects include
    wetlands, forests, croplands, pest control, and private lands.  The wildlife section
    of the report discusses endangered species, threatened species, waterfowl, marsh
    birds, water birds, shorebirds, raptors, and game mammals.  The public uses of the
    Refuge described in this report include outdoor classrooms, interpretive exhibits,
    hunting, wildlife observation, and law enforcement.  The equipment and facilities
    section of the report provides information about new construction, rehabilitation,
    major maintenance, equipment utilization/replacement, and computer systems.  Cooperative
    programs and items of interest are provided at the end.",nt"license_title":
